import styled from "styled-components";
import { Link } from "react-router-dom";
import Eventicon from "../img/eventicon.png";
import Infoicon from "../img/infoicon.png";

const FooterConatiner = styled.div`
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  position: absolute;
  width: 100%;
  height: 12rem;
  background-color: var(--cream);
  bottom: 0;
  border: 1px solid var(--border);
  box-sizing: border-box;
`;

const Menus = styled.ul`
  display: flex;
  justify-content: space-evenly;
  width: 100%;
`;
const Menu = styled.li`
  font-size: 1.5rem;
  font-weight: 400;
  margin-right: 1.5rem;
  display: flex;
  list-style: none;
  &:first-child {
    justify-content: flex-start;
  }
  &:nth-child(2) {
    width: 15rem;
  }
  &:last-child {
    justify-content: flex-end;
  }
`;
const Icon = styled.img`
  width: 150px;
`;

function Footer() {
  return (
    <FooterConatiner>
      <Menus>
        <Menu>
          <Link to={"/club_info"}>
            <Icon src={Infoicon} />
          </Link>
        </Menu>
        <Menu></Menu>
        <Menu>
          <Link to={"/event"}>
            <Icon src={Eventicon} />
          </Link>
        </Menu>
      </Menus>
    </FooterConatiner>
  );
}

export default Footer;
